/*Write a C program to find the third angle of a triangle if two angles are given.*/
#include<stdio.h>
void main()
{
    int a,b,c;
    scanf("%d%d",&a,&b);
    c=180-(a+b);
    printf("Third Angle=%d",c);
}

/*Write a C++ program to find the third angle of a triangle if two angles are given.*/
#include<iostream>
using namespace std;
int main()
{
    int a,b,c;
    cin>>a>>b;
    c=180-(a+b);
    cout<<"Third Angle="<<c;
}

/*Write a Java program to find the third angle of a triangle if two angles are given.*/
import java.util.Scanner;
public class Funycode {
    public static void main(String[] args) {

        Scanner z=new Scanner(System.in);
        int a,b,c;
        a=z.nextInt();
        b=z.nextInt();
        c=180-(a+b);
        System.out.println("Third Angle:="+c);

    }
}

